import { useEffect, useMemo,useState } from "react";
function App() {
  const [state,setState]=useState([]);
  const lists=useMemo(()=>{
    let mass=state.filter((elem)=>{
      return elem.volumeInfo.imageLinks!=undefined
    })
    return mass.map((elem)=><img src={elem.volumeInfo.imageLinks.thumbnail}/>)
  },[state.length])
  useEffect(() => {
    const key = "AIzaSyBEIqK7j9rLo7FHM4Fdl41EITEsGLHFx9E", book = "Harry Poter";
    fetch(`https://www.googleapis.com/books/v1/volumes/?q=${book}+inauthor:J K Rowling&key=${key}&maxResults=40`)
    .then((res) => {
      res.json().then((mess)=>{
        setState(mess.items)
      })
    });
  }, []);
  return (<>
    {lists}
  </>)
}
export default App;

